import React, { useState } from "react";
import { createComponent } from "react-fela";
import Link from "next/link";
import { HeadingMedium } from "./StyledText";

const navigationBar = ({ color = "black" }) => ({
  display: "flex"
});

const NavigationBar = createComponent(navigationBar, "nav");

const dropdownArea = ({ color = "black" }) => ({
  float: "left",
  overflow: "hidden"
});

const DropdownArea = createComponent(dropdownArea, "nav");

const Navigation = ({ animations }) => (
  <NavigationBar>
    <HeadingMedium>Animation Library </HeadingMedium>
    <div>
      <button> V </button>
      <div>
        {animations.map(item => (
          <li>
            <Link href={`/${item.animationKey}`}>{item.animationName}</Link>
          </li>
        ))}
      </div>
    </div>
  </NavigationBar>
);

export default Navigation;
